import Tolma from "../images/tolma.jpg";
import Xash from "../images/xash.jpg";
import Xapama from "../images/xapama.webp";
import Xoravac from "../images/xorovac.jpg";
import Jengal from "../images/jengal.jpg";
import Harisa from "../images/harisa.jpg";

export const MenuList = [
  {
    name: "Տոլմա",
    description:
      "Հայաստանում տոլման ամենատարածված և ամենահայտնի ուտեստներից մեկն է։",
    image: Tolma,
    price: 200,
  },
  {
    name: "Խաշ",
    description:
      "Խաշ, հեղուկ տաք ապուր։ Հնագույն հայկական ուտեստներից մեկը։",
    image: Xash,
    price: 250,
  },
  {
    name: "Ղափամա",
    description:
      "Բրնձով, մեղրով, չրեղենով լցոնված դդում։ Կան նաեւ Խափանայի՝ գառան։",
    image: Xapama,
    price: 300,
  },
  {
    name: "Խորաված",
    description:
    "Համենված միս, որը լինում է խոզի, հավի և այլ մսի տեսակններով։",
    image: Xoravac,
    price: 100,
  },
  {
    name: "Ժինգյալով հաց",
    description:
      "Ժենգյալով հաց (որոշ շրջաններում այն նաև կոչվում է «Պինջարով հաց»։",
    image: Jengal,
